import React, { Component } from 'react';
import Imagem from './foto.jpg';

class Imagens extends Component {

    render() {
        return (
            <img src={Imagem}/>

        )
    }
    className = StyleSheet.create({
        backgroundImage: {
            resizeMode: 'cover',
            flex: 1,
            justifyContent: 'center',
            alignItems: 'center',
            position: 'absolute',
            width: '100%',
            height: '100%',
        }
    
})
}

export default Imagens;
